import 'package:flutter/material.dart';

void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
      home: ImageList(),
    );
  }
}

class ImageList extends StatefulWidget {
  const ImageList({super.key});

  @override
  State<ImageList> createState() => _ImageListstate();
}

class _ImageListstate extends State<ImageList> {
  List<List> cricketPlayerList = [
    [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,"
    ],
    [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,"
    ],
    [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "https://img1.hscicdn.com/image/upload/f_auto,t_ds_w_1200,q_50/lsci/db/PICTURES/CMS/376000/376074.jpg"
    ]
  ];

  int count = 0;

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("Player Info"),
      ),
      body: ListView.separated(
        itemCount: cricketPlayerList.length,
        itemBuilder: (context, index1) {
          return Column(
            children: [
              Text((index1 == 0)
                  ? "ODI"
                  : (index1 == 1)
                      ? "T20"
                      : "Test"),
              ListView.builder(
                  shrinkWrap: true,
                  // physics: NeverScrollableScrollPhysics(),
                  itemCount: cricketPlayerList[index1].length,
                  itemBuilder: (context, index) {
                    return Container(
                      height: 200,
                      width: 100,
                      margin: const EdgeInsets.all(10),
                      child: Image.network(
                        cricketPlayerList[index1][index],
                        fit: BoxFit.contain,
                      ),
                    );
                  }),
            ],
          );
        },
        separatorBuilder: (context, index) {
          return const Center(
              child: Divider(
            color: Colors.black,
          ));
        },
      ),
    );
  }
}
